import React from 'react';
import { AppBar, styled, Toolbar, Typography, Box, InputBase, Badge, Avatar} from '@mui/material';
import SportsEsportsIcon from '@mui/icons-material/SportsEsports';
import { Mail, Notifications} from "@mui/icons-material";

const Styledtoolbar = styled(Toolbar)({
    display: "flex",
    justifyContent: "space-between",
})
const Search = styled("div")(({theme})=>({
    backgroundColor: "white",
    padding: "0px 10px",
    borderRadius: theme.shape.borderRadius,
    width: "40%"
}))
const Icon = styled(Box)(({theme})=>({
    display: "flex",
    gap: "20px",
    alignItems: "center",
}))
const UserBox = styled(Box)(({theme})=>({
    display: "flex",

}))
const Navbar = ()=>{
    return (
        <AppBar  position="sticky">
            <Styledtoolbar>
            <Typography variant="h5"  sx={{display:{xs: "none", sm: "block"}}}>
                Rgram
            </Typography>
            <SportsEsportsIcon sx={{display:{xs: "block", sm: "none"}}}/>
            <Search>
                <InputBase placeholder="search..."/>
                </Search>
            <Icon>
                <Badge badgeContent={4} color="error">
                    <Mail/>
                </Badge>
                <Badge badgeContent={4} color="error">
                    <Notifications/>
                </Badge>
                <Avatar sx={{width: 30, height: 30}} alt="Roshan kc" src="https://avatars.githubusercontent.com/u/83297534?v=4" />
     
            </Icon>
            <UserBox>
                    <Avatar sx={{width: 30, height: 30}} alt="Roshan kc" src="https://avatars.githubusercontent.com/u/83297534?v=4" />
                    <Typography variant="h6">
                        Roshan kc
                    </Typography>
                </UserBox>
            </Styledtoolbar>
            
        </AppBar>

    )
}
export default Navbar;
